import axios from 'axios'

export const createUser = user => {
    return async dispatch => {
    await axios.post('/create-user',user)
        .then(data => {
            console.log('res ' + data)
            return(
                localStorage.setItem("token", data.token)
                )
            // dispatch(loginUser(res.user))
        })
    }
}
